import { LeftOutlined, RightOutlined } from '@ant-design/icons'
import { Drawer } from 'antd'
import { useState } from 'react'
import { Link, useLocation } from 'react-router-dom'
import logoDevCollapsed from '../assets/images/blitz-dev-logo-collapsed.png'
import logoDev from '../assets/images/blitz-dev-logo.png'
import logoCollapsed from '../assets/images/blitz-logo-collapsed.png'
import logo from '../assets/images/blitz-logo.png'
import logoClickerCollapsed from '../assets/images/clicker-logo-collapsed.png'
import logoClicker from '../assets/images/clicker-logo.png'
import { config } from '../Common/config'
import { INKAMOTORS_COMPONY_ID } from '../Common/constants'
import { useDevice } from '../Common/Hooks/useDevice'
import { StyleBrandLogo, StyleSider, StyleSimpleBar } from '../Common/SidebarStyle'
import { themecolor } from '../config'
import { useStoredUser } from '../lib/authContext'
import { AsideWrapper, MenuStyled, TriggerAsideShadowStyled, TriggerAsideStyled } from './styles'
import { useSidebarItems } from './useSidebarItems'

export const COLLAPSED_WIDTH = '56px'

export const Sidebar = ({ collapsed, onClickCollapse }) => {
  const location = useLocation()
  const { normalItems, superAdminItems } = useSidebarItems()
  const { user } = useStoredUser()
  const { isDesktop } = useDevice()

  const items = user.is_superadmin ? superAdminItems : normalItems

  const [activatedItem, setActivatedItem] = useState(() => {
    const currentPath = location.pathname.replace('/', '')
    return currentPath || 'dashboard'
  })

  const toggleActivation = key => {
    setActivatedItem(prevActivatedItem => (prevActivatedItem === key ? null : key))
  }

  const getLogo = () => {
    if (user?.company_id === INKAMOTORS_COMPONY_ID) {
      return logoClicker
    }
    if (config.env === 'dev') {
      return logoDev
    }
    return logo
  }

  const getCollapseLogo = () => {
    if (user?.company_id === INKAMOTORS_COMPONY_ID) {
      return logoClickerCollapsed
    }
    if (config.env === 'dev') {
      return logoDevCollapsed
    }
    return logoCollapsed
  }

  const menu = (
    <MenuStyled
      $collapsed={collapsed}
      selectedKeys={[activatedItem]}
      defaultOpenKeys={items.map(item => item?.key ?? '')}
      mode="inline"
      theme="light"
      items={items}
      onClick={({ key }) => toggleActivation(key)}
    />
  )

  if (isDesktop) {
    return (
      <AsideWrapper>
        <TriggerAsideShadowStyled />
        <TriggerAsideStyled onClick={onClickCollapse}>
          {collapsed ? (
            <RightOutlined
              style={{
                position: 'absolute',
                left: '-14px',
                top: '50%',
                transform: 'translateY(-50%)',
              }}
            />
          ) : (
            <LeftOutlined
              style={{
                position: 'absolute',
                left: '-14px',
                top: '50%',
                transform: 'translateY(-50%)',
              }}
            />
          )}
        </TriggerAsideStyled>
        <StyleSider
          id="sidebar-layout"
          width={themecolor.components.Menu.verticalSidebarWidth}
          collapsed={collapsed}
          collapsedWidth={COLLAPSED_WIDTH}
          breakpoint="lg"
        >
          <StyleBrandLogo className="demo-logo">
            <Link to="/" className="link-logo">
              <img
                alt="Brand logo"
                src={getLogo()}
                height={30}
                style={{ lineHeight: '24px', height: 70 }}
                className="brand-dark-logo ant-ml-0 ant-mr-auto"
              />
              <img
                alt="Brand sm logo"
                src={getCollapseLogo()}
                height={24}
                style={{ lineHeight: '24px', height: 70 }}
                className="brand-sm-logo ant-ml-0 ant-mr-auto"
              />
            </Link>
          </StyleBrandLogo>

          <div>
            <StyleSimpleBar>{items.filter(item => item).length > 0 && menu}</StyleSimpleBar>
          </div>
        </StyleSider>
      </AsideWrapper>
    )
  }

  return (
    <Drawer
      open={collapsed}
      onClose={onClickCollapse}
      placement="left"
      styles={{
        body: {
          padding: 0,
        },
      }}
    >
      {menu}
    </Drawer>
  )
}
